import './App.css';
import HomePage from './components/HomePage';
import Quiz from './components/QuizPage';
import {
  Routes,
  BrowserRouter as Router,
  Route
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>

          <Route path='/' element={<HomePage />} />
          <Route path='/quiz' element={<Quiz />} />

        </Routes>
      </Router>

    </div>
  );
}

export default App;
